public class InnerIndexUserTokenConfigurationFactory(Action<Humidifier.Kendra.IndexTypes.UserTokenConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.IndexTypes.UserTokenConfiguration>
{

    internal InnerIndexJwtTokenTypeConfigurationFactory JwtTokenTypeConfigurationFactory { get; set; }

    internal InnerIndexJsonTokenTypeConfigurationFactory JsonTokenTypeConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.IndexTypes.UserTokenConfiguration Create()
    {
        var userTokenConfigurationResult = CreateUserTokenConfiguration();
        factoryAction?.Invoke(userTokenConfigurationResult);

        return userTokenConfigurationResult;
    }

    private Humidifier.Kendra.IndexTypes.UserTokenConfiguration CreateUserTokenConfiguration()
    {
        var userTokenConfigurationResult = new Humidifier.Kendra.IndexTypes.UserTokenConfiguration();

        return userTokenConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.IndexTypes.UserTokenConfiguration result)
    {
        base.CreateChildren(result);

        result.JwtTokenTypeConfiguration ??= JwtTokenTypeConfigurationFactory?.Build();
        result.JsonTokenTypeConfiguration ??= JsonTokenTypeConfigurationFactory?.Build();
    }

} // End Of Class

